/**
 * SIGMA-AETL — Normalized JSON Document
 * Option A (RECOMMENDED): PASS-THROUGH metadata
 *
 * Rules:
 * - DO NOT generate IDs here
 * - DO NOT modify etl_metadata
 * - DO NOT modify transport_metadata
 * - Normalize top-level fields only
 */

const input = $json;

// -----------------------------
// 1. Normalize top-level fields
// -----------------------------
const normalized = {
  root_cause: input.root_cause ?? "unknown",
  missing_or_invalid_fields: Array.isArray(input.missing_or_invalid_fields)
    ? input.missing_or_invalid_fields
    : [],
  why_it_failed: input.why_it_failed ?? "unknown",
  proposed_fix: input.proposed_fix ?? "unknown",
  business_implication: input.business_implication ?? "unknown",
  workflow_run_id: input.workflow_run_id ?? "unknown",
  received_at: input.received_at ?? new Date().toISOString(),
  validator_version: input.validator_version ?? "v1.0.0",
  source_system: input.source_system ?? "SIGMA-AETL",
  pipeline_version: input.pipeline_version ?? "v1.0.0",
  log_level: input.log_level ?? "ERROR"
};

// ---------------------------------
// 2. PASS-THROUGH metadata (CRITICAL)
// ---------------------------------
normalized.etl_metadata = input.etl_metadata ?? null;
normalized.transport_metadata = input.transport_metadata ?? null;
normalized.kafka_metadata = input.kafka_metadata ?? null;

// ---------------------------------
// 3. Emit final Mongo-safe document
// ---------------------------------
return normalized;

// Unwrap Kafka Message (robust + diagnostic)
//
// Goals:
// 1) Extract the Kafka "message value" reliably (string/object/buffer)
// 2) Parse JSON only when it actually looks like JSON
// 3) Preserve kafka_metadata
// 4) Emit diagnostics so we can confirm what the trigger is delivering

const msg = $json;

// -------------------------------
// Helper: normalize candidate value to string/object
// -------------------------------
function normalizeValue(v) {
  if (v === undefined || v === null) return { kind: "null", value: null, text: null };

  // Buffer (Node.js)
  if (typeof Buffer !== "undefined" && Buffer.isBuffer(v)) {
    const text = v.toString("utf8");
    return { kind: "buffer", value: v, text };
  }

  // Already an object (including arrays)
  if (typeof v === "object") {
    return { kind: "object", value: v, text: null };
  }

  // Primitive string/number/bool
  if (typeof v === "string") return { kind: "string", value: v, text: v };
  return { kind: typeof v, value: v, text: String(v) };
}

// -------------------------------
// Find the most likely Kafka payload field
// -------------------------------
const candidates = {
  message: msg.message,
  value: msg.value,
  data: msg.data,
};

let chosenKey = null;
let chosen = null;

for (const k of Object.keys(candidates)) {
  if (candidates[k] !== undefined) {
    chosenKey = k;
    chosen = normalizeValue(candidates[k]);
    break;
  }
}

if (!chosen) {
  chosenKey = "none";
  chosen = { kind: "missing", value: null, text: null };
}

// -------------------------------
// Attempt JSON parse (only if it looks like JSON)
// -------------------------------
let payload = null;
let is_parse_error = false;
let parse_error = null;

try {
  if (chosen.kind === "object") {
    payload = chosen.value;
  } else if (chosen.kind === "string" || chosen.kind === "buffer") {
    const rawText = (chosen.text ?? "").trim();

    // If empty -> treat as error (this matches your “Unexpected end of JSON input” symptom)
    if (!rawText) {
      is_parse_error = true;
      parse_error = "Empty message value (cannot JSON.parse)";
      payload = { _raw_message: rawText, _parse_error: parse_error };
    } else {
      const looksJson = rawText.startsWith("{") || rawText.startsWith("[");
      if (looksJson) {
        payload = JSON.parse(rawText);
      } else {
        // Not JSON: keep as raw string
        payload = { _raw_message: rawText };
      }
    }
  } else {
    payload = { _raw_message: chosen.text ?? null };
  }
} catch (e) {
  is_parse_error = true;
  parse_error = e?.message ?? String(e);
  payload = { _raw_message: chosen.text ?? null, _parse_error: parse_error };
}

// -------------------------------
// Defensive timestamp handling
// -------------------------------
let kafkaTimestamp = null;
if (msg.timestamp) {
  try {
    const parsed = new Date(msg.timestamp);
    if (!isNaN(parsed.getTime())) kafkaTimestamp = parsed.toISOString();
  } catch (_) {}
}

// -------------------------------
// Kafka metadata (what we can extract)
// -------------------------------
const kafka_metadata = {
  topic: msg.topic ?? null,
  partition: msg.partition ?? null,
  offset: msg.offset ?? null,
  key: msg.key ?? null,
  timestamp: kafkaTimestamp,
  consumer_group: "n8n-sigma-aetl-validator",
};

// -------------------------------
// Output: include diagnostics so we can see what Kafka Trigger is emitting
// -------------------------------
return [
  {
    json: {
      // Diagnostics first
      unwrap_debug: {
        chosenField: chosenKey,
        chosenKind: chosen.kind,
        rawPreview:
          typeof chosen.text === "string"
            ? chosen.text.slice(0, 500)
            : null,
        parse_error,
      },

      is_parse_error,
      payload,
      kafka_metadata,
    },
  },
];

/**
 * ATTACH ETL METADATA — CANONICAL + SAFE VERSION
 * - Guarantees unique machine_generated_id
 * - Preserves Kafka metadata if present
 * - Prevents MongoDB duplicate-key violations
 * - Execution-safe and idempotent
 */

const input = $json;

/**
 * 1. Resolve execution identity
 */
const workflowRunId =
  input.workflow_run_id ??
  input.etl_metadata?.workflow_run_id ??
  $execution.id;

const executionTimestamp = new Date().toISOString();

/**
 * 2. Generate a HARD UNIQUE machine_generated_id
 *    (Never allow "unknown")
 */
const machineGeneratedId =
  input.etl_metadata?.machine_generated_id &&
  input.etl_metadata.machine_generated_id !== "unknown"
    ? input.etl_metadata.machine_generated_id
    : `${workflowRunId}-${Date.now()}-${Math.random().toString(36).slice(2, 10)}`;

/**
 * 3. Preserve Kafka metadata EXACTLY if present
 */
const kafkaMetadata = input.kafka_metadata ?? null;

/**
 * 4. Build ETL metadata (execution-scoped, not transport-scoped)
 */
const etl_metadata = {
  workflow_run_id: workflowRunId,
  machine_generated_id: machineGeneratedId,
  validator_version: input.validator_version ?? "v1.0.0",
  sentinel_version: "sigma-sentinel-v1",
  etl_timestamp_utc: executionTimestamp,
  is_valid: Boolean(input.is_valid),
  diagnostic_summary: input.diagnostic_summary ?? null,
  diagnostic_details: input.diagnostic_details ?? null,
  source_payload_raw: input.source_payload_raw ?? null
};

/**
 * 5. Build transport metadata
 */
const transport_metadata = kafkaMetadata
  ? {
      type: "kafka",
      kafka: {
        topic: kafkaMetadata.topic ?? null,
        partition: kafkaMetadata.partition ?? null,
        offset: kafkaMetadata.offset ?? null,
        key: kafkaMetadata.key ?? null,
        consumer_group: kafkaMetadata.consumer_group ?? "n8n-sigma-aetl-validator",
        timestamp: kafkaMetadata.timestamp ?? executionTimestamp
      }
    }
  : {
      type: "manual",
      manual: {
        trigger: "n8n-manual-execution",
        user: "system",
        timestamp: executionTimestamp
      }
    };

/**
 * 6. Emit FINAL document (Mongo-safe)
 */
return {
  ...input,
  kafka_metadata: kafkaMetadata,
  etl_metadata,
  transport_metadata
};

const input = $json;

// ---- Transport metadata resolution (Kafka-first, deterministic) ----

// Support BOTH conventions:
// - kafka_metadata (from Prepare Validator Payload node)
// - _kafka_metadata (from legacy Unwrap node)
const kafkaMeta =
  input.kafka_metadata ??
  input._kafka_metadata ??
  null;

// HARD ASSERT: if Kafka metadata exists → transport = kafka
const transport_metadata = kafkaMeta
  ? {
      type: "kafka",
      kafka: {
        topic: kafkaMeta.topic ?? null,
        partition: kafkaMeta.partition ?? null,
        offset: kafkaMeta.offset ?? null,
        consumer_group: kafkaMeta.consumer_group ?? "n8n-sigma-aetl-validator",
        timestamp: kafkaMeta.timestamp ?? new Date().toISOString()
      }
    }
  : {
      type: "manual",
      manual: {
        trigger: "n8n-manual-execution",
        user: "system",
        timestamp: new Date().toISOString()
      }
    };

// ---- Output document (MongoDB-ready) ----

return [
  {
    json: {
      // ---- Validation diagnostics ----
      root_cause: input.root_cause ?? null,
      missing_or_invalid_fields: input.missing_or_invalid_fields ?? [],
      why_it_failed: input.why_it_failed ?? null,
      proposed_fix: input.proposed_fix ?? null,
      business_implication: input.business_implication ?? null,

      // ---- Pipeline metadata ----
      workflow_run_id: input.workflow_run_id ?? $execution.id,
      received_at: input.received_at ?? new Date().toISOString(),
      validator_version: input.validator_version ?? "unknown",
      source_system: input.source_system ?? "unknown",
      pipeline_version: input.pipeline_version ?? "unknown",
      log_level: input.log_level ?? "ERROR",

      // ---- ETL + Transport metadata ----
      etl_metadata: input.etl_metadata ?? {},
      transport_metadata
    }
  }
];

// ------------------------------------------------------------
// ONE Code node (FIXED)
// Purpose:
// - Build STRICT validator_payload (contract-safe)
// - Read fields from input.payload (from Unwrap node), fallback to root
// - Preserve kafka_metadata untouched
// - Never leak transport metadata into validator
// ------------------------------------------------------------

const input = $json;

// Source of business fields:
// Prefer input.payload (current Unwrap output), fallback to input (legacy/alternate)
const src = (input && typeof input === 'object' && input.payload && typeof input.payload === 'object')
  ? input.payload
  : input;

// -----------------------------
// Extract expected shipment fields
// -----------------------------
const shipment_id  = src.shipment_id  ?? null;
const weight_kg    = src.weight_kg    ?? null;
const destination  = src.destination  ?? null;
const priority     = src.priority     ?? null;

// -----------------------------
// Preserve Kafka metadata (pass-through)
// -----------------------------
const kafka_metadata =
  input.kafka_metadata ??
  input._kafka_metadata ??
  null;

// -----------------------------
// Optional: carry parse status for debugging (does not affect validator contract)
// -----------------------------
const is_parse_error = input.is_parse_error ?? false;

// -----------------------------
// Build validator payload (strict boundary)
// -----------------------------
const validator_payload = {
  shipment_id,
  weight_kg,
  destination,
  priority,

  // Raw payload included ONLY for diagnostics
  raw_payload: {
    shipment_id,
    weight_kg,
    destination,
    priority
  }
};

// -----------------------------
// Final output
// -----------------------------
return [
  {
    json: {
      validator_payload,
      kafka_metadata,
      is_parse_error
    }
  }
];
